import React from 'react';
import { useParams } from 'react-router-dom';

const UserDetail = () => {
  const { id } = useParams();

  return (
    <div>
      <h1>User Detail</h1>
      <p>User ID: {id}</p>
      {/* Lägg till logik för att visa detaljer om användaren */}
    </div>
  );
};

export default UserDetail;
